// ConsoleApplication1.cpp : Ð­Ñ‚Ð¾Ñ‚ Ñ„Ð°Ð¹Ð» ÑÐ¾Ð´ÐµÑ€Ð¶Ð¸Ñ‚ Ñ„ÑƒÐ½ÐºÑ†Ð¸ÑŽ "main". Ð—Ð´ÐµÑÑŒ Ð½Ð°Ñ‡Ð¸Ð½Ð°ÐµÑ‚ÑÑ Ð¸ Ð·Ð°ÐºÐ°Ð½Ñ‡Ð¸Ð²Ð°ÐµÑ‚ÑÑ Ð²Ñ‹Ð¿Ð¾Ð»Ð½ÐµÐ½Ð¸Ðµ Ð¿Ñ€Ð¾Ð³Ñ€Ð°Ð¼Ð¼Ñ‹.
//

#include <iostream>
#include <vector>
#include <queue>
#include <algorithm>
#include <map>
#include <fstream>

using namespace std;

struct cell
{
    int r, c;
    bool operator<(const cell &rhs)const
    {
        return r < rhs.r || (r == rhs.r && c < rhs.c);
    }
    cell operator+(cell rhs)
    {
        return { r + rhs.r,c + rhs.c };
    }
    bool is_inside(int rows, int cols)
    {
        return 0 <= r && r < rows && 0 <= c && c < cols;
    }
};

static vector<cell> directions{ {0,1},{1,0},{-1,0},{0,-1} };
static int infty = 1'000'000;

class labyrinth
{
    vector<vector<char>> m;
public:
    labyrinth(size_t rows, size_t cols)
    {
        m.assign(rows, vector<char>(cols,'.'));
    }
    vector<char>& operator[](int row) 
    {
        return m[row];
    }
    const vector<char>& operator[](int row) const
    {
        return m[row];
    }
    char& operator()(const cell& C)
    {
        return m[C.r][C.c];
    }
    const char& operator()(const cell& C) const
    {
        return m[C.r][C.c];
    }
    int rows() const
    {
        return m.size();
    }
    int cols() const
    {
        return m.size() == 0 ? 0 : m[0].size();
    }
};

labyrinth get_lab_from_stream(istream& inp)
{
    int rows, cols;
    inp >> rows >> cols;
    labyrinth lab(rows, cols);
    for (size_t i = 0; i < rows; i++)
    {
        for (size_t j = 0; j < cols; j++)
        {
            inp >> lab[lab.rows()-i-1][j];
        }
    }
    return lab;
}

void BFS(const labyrinth& lab, cell s, map<cell, int>& d, map<cell, cell>& p, bool requires_init)
{
    if (requires_init)
    {
        for (int i = 0; i < lab.rows(); i++)
            for (int j = 0; j < lab.cols(); j++)
            {
                d[{i, j}] = infty; //lab.rows() * lab.cols();
                p[{i, j}] = { -1,-1 };
            }
    }
    d[s] = 0;
    queue<cell> Q;
    Q.push(s);
    while (Q.size())
    {
        auto u = Q.front();
        Q.pop();
        for (auto dir : directions)
        {
            auto v = u + dir;
            if (!v.is_inside(lab.rows(), lab.cols())) continue;
            if (lab(v) != '#' && d[v] > d[u] + 1)
            {
                d[v] = d[u] + 1;
                p[v] = u;
                Q.push(v);
            }
        }
    }
}

//Ð’Ð°ÑÑ Ð¸ Ð¿Ð¾Ñ‚Ð¾Ð¿
//flood_speed - Ð¸Ð½Ñ‚ÐµÑ€Ð²Ð°Ð» Ð·Ð°Ñ‚Ð¾Ð¿Ð»ÐµÐ½Ð¸Ñ Ð¾Ñ‡ÐµÑ€ÐµÐ´Ð½Ð¾Ð³Ð¾ ÑƒÑ€Ð¾Ð²Ð½Ñ
void BFS2(const labyrinth& lab, cell s, double flood_speed, map<cell, int>& d, map<cell, cell>& p, bool requires_init)
{
    if (requires_init)
    {
        for (int i = 0; i < lab.rows(); i++)
            for (int j = 0; j < lab.cols(); j++)
            {
                d[{i, j}] = infty; //lab.rows() * lab.cols();
                p[{i, j}] = { -1,-1 };
            }
    }
    d[s] = 0;
    queue<cell> Q;
    Q.push(s);
    while (Q.size())
    {
        auto u = Q.front();
        Q.pop();
        for (auto dir : directions)
        {
            auto v = u + dir;
            if (!v.is_inside(lab.rows(), lab.cols())) continue;
            if (lab(v) != '#' && d[v] > d[u] + 1 && v.r>=floor(d[u]/flood_speed))
            {
                d[v] = d[u] + 1;
                p[v] = u;
                Q.push(v);
            }
        }
    }
}

vector<cell> get_path(map<cell, int>& d, map<cell, cell>& p, cell dest)
{
    vector<cell> res;
    if (d[dest] == infty)
        return res;
    res.push_back(dest);
    while (d[res.back()] > 0)
        res.push_back(p[res.back()]);
    reverse(begin(res), end(res));
    return res;
}

int main()
{
    fstream inp("lab.txt");
    auto lab = get_lab_from_stream(inp);
    map<cell, int> d; 
    map<cell, cell> p;
    BFS2(lab, { 0,0 }, 3.1, d, p, true);

    std::cout << d[{ lab.rows() - 1,lab.cols() - 1 }] << std::endl;

    auto path = get_path(d, p, { lab.rows() - 1,lab.cols() - 1 });
    for (auto v : path)
        std::cout << '(' << v.r << ',' << v.c << ") ";

    std::cout << "\n";
}

