                {
                    Console.WriteLine("Ð’ Ð¼Ð°Ð³Ð°Ð·Ð¸Ð½Ðµ Ð½ÐµÑ‚ Ñ‚Ð°ÐºÐ¾Ð³Ð¾ Ñ‚Ð¾Ð²Ð°Ñ€Ð°.");
